import React, { Component } from "react";
import { NavLink } from "react-router-dom";

class Index extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavLink to="/clicker">Clicker</NavLink>
        <NavLink to="/clock">Clock</NavLink>
      </div>
    );
  }
}

export default Index;
